import React, { Component } from 'react'
import { Link } from 'react-router-dom'

export default class CreateTeam extends Component {
    render() {
        return (
            <div >
                <div className='row'>

                    <div className='col'>
                        <div class="card" >
                            <div class="card-body">
                            </div>
                        </div>
                    </div>

                    <div className='col'></div>

                </div>
            </div>

        )
    }
}
